        expect(hints[0]).toEqual(['bad', 'bad']);
        expect(hints[1]).toEqual(['poor', 'poor']);
        expect(hints[2]).toEqual(['regular', 'regular']);
        expect(hints[3]).toEqual(['good', 'good']);
        expect(hints[4]).toEqual(['gorgeous', 'gorgeous']);
